    $to.attr('min', data.minYear);
    $to.attr('max', data.maxYear);
    $from.val(data.yearFrom);
    $to.val(data.yearTo);
    $from.trigger('change');
    $to.trigger('change');
    let minMaxedFrom = parseInt($from.attr('value'));
    let minMaxedTo = parseInt($to.attr('value'));
    data.yearFrom = minMaxedFrom;
    data.yearTo = minMaxedTo;
